import Vue from 'vue'
import Router from 'vue-router'
import main from '../pages/MainPage'
import add from '../pages/AddPage'

Vue.use(Router);

let router = new router({
    routes:[
            {
                path:'/',
                name:'main',
                component: main,
            },
            {
                path:'/add',
                name:'add',
                component: add,
            }
        ]
    })

export default router;
